import ExpenseItem from "./ExpenseItem";
import ExpenseDate from "./ExpenseDate";
import "./Expense.css"

function Expense(props) {
    return (
        <div className="expenses">
            <ExpenseDate
                date={props[0].date}
            />
            <ExpenseItem
                title={props[0].title}
                amount={props[0].amount}
            />
        </div>
    );
}

export default Expense;
